window.addEventListener("DOMContentLoaded",(function(){window.location.pathname;const t=document.querySelectorAll(".navigation_link");for(let e=0;e<t.length;e++){const n=t[e];"#"===n.getAttribute("href")?(n.classList.add("active-link"),n.addEventListener("click",(function(t){t.preventDefault()}))):n.classList.remove("active-link")}}));